;; **
;;; There are 17 graphs. The program below uses the alternate loop statement and produces a history graph with 115 graphs. (It also takes longer, please be patient.)
;; **

;; @@
(-> (newgrape) setup-ferryman
    (->*! all_on_the_other_side!
          (|| ferry_one_over cross_empty)
          (can-eat!- "Wolf" "Goat")
          (can-eat!- "Goat" "Grape")))
(-> _ history steps flatten count)
